  namespace: VDS.RDF.Ontology
  summary: "\nRepresents a Graph with a reasoner attached.\n"
  remarks: "\n<p>\nThis class wraps an existing Graph and applies the given reasoner to it materialising the Triples in this Graph.  The original Graph itself is not modified but can be accessed if necessary using the <xref href=\"VDS.RDF.Ontology.ReasonerGraph.BaseGraph\" data-throw-if-not-resolved=\"false\"></xref> property.\n</p>\n<p>\nAny changes to this Graph (via <xref href=\"VDS.RDF.IGraph.Assert(VDS.RDF.Triple)\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"VDS.RDF.IGraph.Retract(VDS.RDF.Triple)\" data-throw-if-not-resolved=\"false\"></xref>) affect this Graph - specifically the set of materialised Triples - rather than the original Graph around which this Graph is a wrapper.\n</p>\n<p>\nSee <a href=\"http://www.dotnetrdf.org/content.asp?pageID=Ontology%20API\">Using the Ontology API</a> for some informal documentation on the use of the Ontology namespace.\n</p>\n"
  example: []
